import React, {useState} from 'react';
import {Box, Button, Grid} from "@material-ui/core";

import {useStyles} from "./style";
import SignUp from "./SIgnUp";
import SignIn from "./SignIn";
const SignForms = () => {
    const classes = useStyles()
    const [active, setActive] = useState(true)
    console.log(active)
    return (
        <Grid className={classes.wrapper}>
            <Box className={`${classes.container} ${classes.signUp}`}>
                <SignUp />
            </Box>
            <Box className={`${classes.container} ${classes.signIn}`}>
                <SignIn />
            </Box>
            <Box className={classes.overlayContainer}>
                <Box className={classes.overlay}>
                    <Box className={`${classes.overlayPanel} ${classes.overlayLeft}`}>
                        <h1>Welcome Back!</h1>
                        <p>To keep connected with us please login with your personal info</p>
                        <Button onClick={() => {setActive(false)}} className="ghost" id="signIn">Sign In</Button>
                    </Box>
                    <Box className={`${classes.overlayPanel} ${classes.overlayRight}`}>
                        <h1>Hello, Friend!</h1>
                        <p>Enter your personal details and start journey with us</p>
                        <Button onClick={() => {setActive(true)}} className="ghost" id="signUp">Sign Up</Button>
                    </Box>
                </Box>
            </Box>
        </Grid>
    );
};

export default SignForms;
